import React from "react";
import Cards from "./Cards";
import Sdata from "./Sdata";

// console.log(Sdata[0]);
function ncard(val){
    return(
        <Cards 
                imgsrc={Sdata[0].imgscr} 
                category={Sdata[0].categorys} 
                title={Sdata[0].titles} 
                link={Sdata[0].links} />
    );
}

function App(){
    return(
        <>
            <div className="container">
                <h1>Featured Products</h1>
                
            </div>
            Sdata.map(ncard);
        </>
    );
}   

export default App;
